var TB={util:util={getById:t=>document.getElementById(t),changeButtonText:(t,e)=>{t.innerHTML=e},changeButtonTextAndColor:changeButtonTextAndColor=((t,e,n)=>{t.innerHTML=e,t.style.backgroundColor=n}),showByButton:t=>{for(var e=0;t.classList.length>e;e++){"hidden"==t.classList[e]&&t.classList.remove("hidden")}},hideByButton:t=>{for(var e=0;t.classList.length>e;e++){"hidden"!=t.classList[e]&&t.classList.add("hidden")}},toggleVisibility:t=>{t.classList.toggle("hidden")}}};